// TODO: add a Mersenne Twister for comparison, and benchmark 
const xor = require('./xor')
const processSeed = require('../process-seed')
const Distribution = require('../distribution')

// TODO: add specific tests for prng wrapper
module.exports = (seeded, initseed) => {
  // initialise prng functions
  const { reseed, getState, setState, random: prngRandom } = xor(0)

  // seed prng with initial seed
  reseed(processSeed(initseed))

  // capture initial prng state
  const initialState = getState()

  // TODO: should be normalized to serialised string for portability?
  // define prng state getter/setter method
  const state = newVal => {
    // if called with no arguments, return state
    // else if called with null, reset state and return seeded instance
    // else if called with value, set state to value and return seeded instance
    if (newVal === undefined) {
      return getState()
    } else {
      if (newVal === null) {
        setState(initialState)
      } else {
        setState(newVal)
      }
      return seeded
    }
  }

  const distribution = Distribution(seeded)

  // define prng reset method
  const reset = seed => {
    reseed(processSeed(seed !== undefined ? seed : initseed))
    return seeded
  }

  // define random method based on distribution weighted prng random function
  const random = () => distribution(prngRandom())

  return {
    state,
    reset,
    random,
    distribution
  }
}

const chooser = (position, arr, weights) => {
  const calculatedWeights = arr.reduce((memo, value, index) => {
    memo.push((memo[index - 1] || 0) + (typeof weights[index] === 'number' ? weights[index] : 1))
    return memo
  }, [])

  const target = position * calculatedWeights[calculatedWeights.length - 1]

  // TODO: Binary Tree akin to: https://github.com/plantain-00/weighted-picker/blob/3cdd2c37856bc39c2304d7a597b237cecc845f7e/src/index.ts#L34
  let index

  calculatedWeights.every((weight, i) => {
    if (target > weight) {
      return true
    } else {
      index = i
      return false
    }
  })

  return index
}

module.exports = chooser

const types = require('./types');

const INTS = () => [{ type: types.RANGE , from: 48, to: 57 }];

const WORDS = () => {
  return [
    { type: types.CHAR, value: 95 },
    { type: types.RANGE, from: 97, to: 122 },
    { type: types.RANGE, from: 65, to: 90 }
  ].concat(INTS());
};

const WHITESPACE = () => {
  return [
    { type: types.CHAR, value: 9 },
    { type: types.CHAR, value: 10 },
    { type: types.CHAR, value: 11 },
    { type: types.CHAR, value: 12 },
    { type: types.CHAR, value: 13 },
    { type: types.CHAR, value: 32 },
    { type: types.CHAR, value: 160 },
    { type: types.CHAR, value: 5760 },
    { type: types.RANGE, from: 8192, to: 8202 },
    { type: types.CHAR, value: 8232 },
    { type: types.CHAR, value: 8233 },
    { type: types.CHAR, value: 8239 },
    { type: types.CHAR, value: 8287 },
    { type: types.CHAR, value: 12288 },
    { type: types.CHAR, value: 65279 }
  ];
};

const NOTANYCHAR = () => {
  return [
    { type: types.CHAR, value: 10 },
    { type: types.CHAR, value: 13 },
    { type: types.CHAR, value: 8232 },
    { type: types.CHAR, value: 8233 },
  ];
};

// Predefined class objects.
exports.words = () => ({ type: types.SET, set: WORDS(), not: false });
exports.notWords = () => ({ type: types.SET, set: WORDS(), not: true });
exports.ints = () => ({ type: types.SET, set: INTS(), not: false });
exports.notInts = () => ({ type: types.SET, set: INTS(), not: true });
exports.whitespace = () => ({ type: types.SET, set: WHITESPACE(), not: false });
exports.notWhitespace = () => ({ type: types.SET, set: WHITESPACE(), not: true });
exports.anyChar = () => ({ type: types.SET, set: NOTANYCHAR(), not: true });

