module.exports = registered

// xorshift128 variation of https://en.wikipedia.org/wiki/Xorshift

const baseSeeds = [123456789, 362436069, 521288629, 88675123]

const xor = seed => {
  let [x, y, z, w] = baseSeeds

  const random = () => {
    const t = x ^ (x << 11);
    [x, y, z] = [y, z, w]
    w = w ^ (w >> 19) ^ (t ^ (t >> 8))
    return w / 0x7FFFFFFF
  }

  const seeder = () => Math.round(random() * 1e16)

  const setSeeds = seed => {
    [x, y, z, w] = baseSeeds.map(i => i + seed);
    [x, y, z, w] = [seeder(), seeder(), seeder(), seeder()]
  }

  setSeeds(seed)

  return {
    random: () => random(),
    reseed: setSeeds,
    getState: () => [x, y, z, w],
    setState: seeds => ([x, y, z, w] = seeds)
  }
}

module.exports = xor

const processSeed = inputSeed => {
  if (typeof inputSeed === 'string') {
    // https://github.com/chancejs/chancejs/blob/b1b61100383bc9bfd27907c239e2f1437010e44e/chance.js#L40
    let seed = 0
    for (let i = 0; i < inputSeed.length; i++) {
      let hash = 0
      for (let j = 0; j < inputSeed.length; j++) {
        hash = inputSeed.charCodeAt(j) + (hash << 6) + (hash << 16) - hash
      }
      seed += hash
    }
    return seed
  } else {
    return inputSeed
  }
}

module.exports = processSeed

// define default distribution method as passthrough
const defaultDistribution = i => i

module.exports = seeded => {
  // define initial distribution to be default distribution
  let distribution = defaultDistribution

  // if passed function, set new distribution method
  // if passed null, reset distribution method to default passthrough
  // else call distribution function with passed argument
  return newVal => {
    if (typeof newVal === 'function') {
      distribution = newVal
      return seeded
    } else if (newVal === null) {
      distribution = defaultDistribution
      return seeded
    } else {
      return distribution(newVal)
    }
  }
}

// TODO: should Moon be renamed to something more intuitive like FionaConstructor?
// define main constructor function
function Moon (seedin, Prng) {
  const seeded = this

  // set initial seed from constructor function initialisation argument, or random integer
  const initseed = seedin !== undefined ? seedin : Math.floor(Math.random() * 1e8)

  // initialise PRNG
  const { state, reset, random, distribution } = Prng(seeded, initseed)
  Object.assign(seeded, { state, reset, random, distribution })

  seeded.info = () => ({ initseed })

  return seeded
}

// set up self referencial prototype chain  la jQuery
Moon.prototype = { constructor: Moon }

module.exports = Moon

const number = (seeded, { max = 1e6, min = 0, precision = 0 } = {}) => {
  const multiplier = Math.pow(10, precision)
  return Math.floor(((seeded.random() * (1 + max - min)) + min) * multiplier) / multiplier
}

module.exports = number

