const recurseData = require('../../recurse')

const array = (seeded, qty, input, processor = i => i) => {
  // TODO: I think the processor pattern is used a couple of times, can it be generalised?
  const myProcessor = typeof processor === 'string' ? i => i.join(processor) : processor
  const quantity = typeof qty === 'object' && qty.constructor === Object ? seeded.number(qty) : recurseData(seeded.clone(), qty)
  return myProcessor(recurseData(seeded, Array(quantity).fill(input)))
}

module.exports = array

// TODO: document fiona.String
const recurseData = require('../../recurse')

// TODO: can injected values be same as result of fiona.Array?
const string = (seeded, [a, ...b], ...c) => {
  const reduced = b.reduce((memo, item, index) => memo.concat(c[index], item), [a])
  return recurseData(seeded, reduced).join('')
}

module.exports = string

const chooser = require('./chooser')

// TODO: can the choose method be improved? Can weights be defined as distribution instead?
const choose = (seeded, qty, arr, { weights = [] } = {}) => {
  const myArr = arr.slice(0)
  const myWeightings = weights.slice(0)
  return Array(qty || 0).fill(null).map((v, i) => {
    const index = chooser(seeded.random(), myArr, myWeightings)
    const result = myArr[index]
    myArr[index] = myArr[0]
    myArr.shift()
    return result
  })
}

module.exports = choose

const chooser = require('./chooser')

const oneOf = (seeded, arr, { weights = [] } = {}) => {
  return arr[chooser(seeded.random(), arr, weights)]
}

module.exports = oneOf

const date = (seeded, { min = '1940', max = '2000', long = false } = {}) => {
  const early = new Date(min) * 1
  const late = new Date(max) * 1
  if (early > late) {
    throw Error(`min date must be lower than max date`)
  }
  const diff = late - early
  const date = new Date(seeded.number({ max: diff }) + early).toISOString()
  return long ? date : date.slice(0, 10)
}

module.exports = date

// 10% of the time, reseed with one of 10 seeds
// frequency and pool can be overriden
// TODO: does changing seed change the duplicated values..? I think it should!
const duplicable = (seeded, { frequency = 0.1, pool = 10 } = {}) => {
  if (seeded.random() <= frequency) {
    seeded.reset((Math.floor(seeded.random() * pool + 1) / pool + 1) * 1e16)
  }
  return seeded
}

module.exports = duplicable

const lorem = (seeded, { qty = 15 } = {}) => {
  const out = seeded.random() < 0.2 ? 'lorem ipsum ' : ''
  let words = []
  while (words.length < qty) {
    words = words.concat('dolor sit amet consectetur adipisicing elit sed do eiusmod tempor incididunt ut labore et dolore magna aliqua ut enim ad minim veniam quis nostrud exercitation ullamco laboris nisi ut aliquip ex ea commodo consequat duis aute irure dolor in reprehenderit in voluptate velit esse cillum dolore eu fugiat nulla pariatur excepteur sint occaecat cupidatat non proident sunt in culpa qui officia deserunt mollit anim id est laborum'.split(' '))
  }
  const min = Math.ceil(qty - qty / 3)
  const max = Math.ceil(qty + qty / 3) - 2
  return out + seeded.choose(seeded.number({ min, max }), words).join(' ')
}

const word = seeded => seeded.lorem({ qty: 1 }).split(' ')[0]

const sentence = seeded => {
  const sentence = seeded.lorem({ qty: 25 })
  return sentence[0].toUpperCase() + sentence.slice(1) + '.'
}

// TODO: can I use fiona.Array to generate paragraphs?
